pub fn check_inclusion(s1: String, s2: String) -> bool {
    let mut h1 = vec![0; 26];
    for c in s1.chars() {
        h1[c as usize - 'a' as usize] += 1;
    }

    let s2: Vec<char> = s2.chars().collect();
    let n = s2.len();
    let mut j = 0;
    let mut h2 = vec![0; 26];
    fn ok(h1: &Vec<i32>, h2: &Vec<i32>) -> bool {
        for i in 0..26 {
            if h2[i] > h1[i] {
                return false;
            }
        }
        return true;
    }
    for i in 0..n {
        while j < n {
            h2[s2[j] as usize - 'a' as usize] += 1;
            j += 1;

            if !ok(&h1, &h2) {
                break;
            }
            if h1 == h2 {
                return true;
            }
        }
        if i == 4000 {
            println!("{}", j);
            println!("{:?}", h2);
        }

        h2[s2[i] as usize - 'a' as usize] -= 1;
    }

    false
}

pub fn check_inclusion_0(s1: String, s2: String) -> bool {
    let mut h1 = vec![0; 26];
    for c in s1.chars() {
        h1[c as usize - 'a' as usize] += 1;
    }

    let s2: Vec<char> = s2.chars().collect();
    let n = s2.len();
    for i in 0..n {
        let mut h2 = vec![0; 26];
        for j in i..n {
            h2[s2[j] as usize - 'a' as usize] += 1;
            if h1 == h2 {
                println!("{} {}", i, j);
                return true;
            }
        }
    }

    false
}

fn main() {
    assert_eq!(check_inclusion_0("vxqakfyaqahufxfizupjrkkifjlbfqfeprqrfjvxnubntdtlvz".to_string(), "".to_string()), true);
    assert_eq!(check_inclusion("vxqakfyaqahufxfizupjrkkifjlbfqfeprqrfjvxnubntdtlvz".to_string(), "".to_string()), true);
}
